import React from 'react'
import notes from '../Assets/data'

const NotesListPage = () => {
  return (
    <div>
        <div className='NotesList'>
            {
                notes.map(note => (
                    <p>{note.body}</p>
                ))
            }
        </div>
    </div>
  )
}

export default NotesListPage
